import Home from './componentes/Home'
import './App.css';
import {BrowserRouter ,Switch,Route }from 'react-router-dom'




function App() {
  return (

       <Switch>
       <Route path='/'>
       <Home />
       </Route>
       <Route path='/:id'>
       <h1>tipos id</h1>
       </Route>
       <Route exact path='/tipos'>
       <h1>pokemon tipos</h1>
       </Route>
       <Route path='/createpokemon'>
       <h1>pokemon creando</h1>
       </Route>
       </Switch>


  );
}


export default App;
